import React from 'react';
import { SafeAreaView, StyleSheet, Text, View, Image } from 'react-native';

// import { Container } from './styles';

const HomePage = () => {
  return (
   <>
   <SafeAreaView style={styles.container}>
      <View style={styles.cardsContainer}>
         <View style = {styles.card}>
            <Image style={styles.img} source= {{uri: 'http://ddragon.leagueoflegends.com/cdn/10.18.1/img/profileicon/1159.png'}}/>
            <Text>Oi</Text>
            <Text>Level</Text>
            <Image style={styles.img} source= {{uri: 'https://vignette.wikia.nocookie.net/leagueoflegends/images/3/38/Season_2019_-_Unranked.png'}}/>
         </View>
      </View>
   </SafeAreaView>
   </>
  )
}

const styles = StyleSheet.create({
   container:{
      backgroundColor: "#f3f3f3",
      flex: 1,
      alignItems: "center",
      justifyContent: "center",
      
      padding: 30,
   },
   img:{
      height: 180,
      width: 180,      
      alignItems: "center",
   },
})

export default HomePage;
